package com.relife.coffeshops.repositories;

import com.relife.coffeshops.models.ModelProduk;

import java.util.ArrayList;
import java.util.List;
import java.util.UUID;

import androidx.lifecycle.LiveData;
import androidx.lifecycle.MutableLiveData;

public class CoffeRepo {

    private MutableLiveData<List<ModelProduk>> mutabaleProdukList;

    //handle pemanggilan data dari class loadProduk
    public LiveData<List<ModelProduk>> getProduk() {
        if (mutabaleProdukList == null){
            mutabaleProdukList = new MutableLiveData<>();
            loadProduk();
        }
        return mutabaleProdukList;
    }


    //bisa untuk pemanggilan API

    private void loadProduk() {
        List<ModelProduk> produkList = new ArrayList<>();
        produkList.add(new ModelProduk(UUID.randomUUID().toString(), "Nescafe", 25000, "data:image/jpeg;base64,"));
        produkList.add(new ModelProduk(UUID.randomUUID().toString(), "Torabika", 11000, "data:image/jpeg;base64,"));
        produkList.add(new ModelProduk(UUID.randomUUID().toString(), "KapalApi", 16000, "https://fgx6.takenn.com/aitemmu/files/2038/2038_1.jpg"));
        produkList.add(new ModelProduk(UUID.randomUUID().toString(), "White Coffe", 8000, "https://images.tokopedia.net/img/cache/700/VqbcmM/2020/9/8/4855c7fa-5939-4bbd-a3da-94f26d6ed6aa.jpg"));
        produkList.add(new ModelProduk(UUID.randomUUID().toString(), "Robusta", 12000, "https://ecs7.tokopedia.net/img/cache/700/product-1/2018/11/30/3669802/3669802_2614441c-26c5-4caa-bbca-11b614e80071_700_700.jpg"));
        produkList.add(new ModelProduk(UUID.randomUUID().toString(), "Kopi Gajah", 11000, "https://www.static-src.com/wcsstore/Indraprastha/images/catalog/full//92/MTA-12065149/no_brand_kopi_gajah_manis_-_1_dus_x_12_renteng_x_10_sachet_x_25g_-_full02_jeahshr4.jpg"));
        produkList.add(new ModelProduk(UUID.randomUUID().toString(), "CaffeLatte", 14000, "https://ecs7.tokopedia.net/img/cache/200-square/product-1/2020/7/9/3009179/3009179_d7dae120-7489-4c60-bbf5-b24a7e75140f_1280_1280"));
        produkList.add(new ModelProduk(UUID.randomUUID().toString(), "Kopi Toraja", 15000, "data:image/jpeg;base64,"));
        mutabaleProdukList.setValue(produkList);
    }

}
